import React, { useEffect, useState } from "react";
import s from './Disciplina2.module.css'

const Disciplina2 = (props) => {

	const [data, setData] = useState('')
	const [data2, setData2] = useState('')
	const [data1, setData1] = useState(props.year);

	useEffect(() => {
		getDisciplina();
		getDisc();
	}, []);

	let getDisciplina = async () => {
		let response = await fetch('https://def6dcc9-b637-4e72-975e-989d3170335e.mock.pstmn.io/getNumberOfAssessedDisciplines')
		let data = await response.json()
		setData(data)
	}

	let getDisc = async () => {
		let response = await fetch(`https://def6dcc9-b637-4e72-975e-989d3170335e.mock.pstmn.io/getDisciplines/?date=${data1}`)
		let data = await response.json()
		setData2(data)
	}

	return (
		<div className={s.main}>
			<main class="col-md-9 ms-sm-auto col-lg-10 px-md-4">

				<div className={s.main}>

					<div class="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
						<h1>Свод по дисциплинам</h1>
					</div>

					<h3>Количество оцененных дисциплин</h3>
					<div className={s.main2}>
						<div className={s.main3}>
							<h5>Кол-во дисциплин по уч плану:</h5>
							<h5>{data.total}</h5>
							<h5>Кол-во дисциплин, которые оценили студенты:</h5>
							<h5>{data.count}</h5>
						</div>
					</div>
					<div div class="d-flex justify-content-between flex-wrap flex-md-nowrap align-items-center pt-3 pb-2 mb-3 border-bottom">
						<h3>Оценки дисциплин</h3>
					</div>
					<div className="app">
						<div className="row">
							<div className="mixed-chart">
								<div className={s.main__elements}>
								
								
									<tr><th>Дисциплина⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀</th><th>q0</th><th>q1</th><th>q2</th><th>q3</th><th>q4</th><th>q5</th><th>q6</th><th>Количество преподавателей</th><th>Количество студентов</th></tr>
									
									{data2 && data2.map(customer => (
										<div key={customer.name}>
											
										
                                            
											<tr><th>⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀</th><th>⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀</th><th>⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀</th></tr>
											<tr><td>{customer.name}</td><td>{customer.q[0]}</td><td>{customer.q[1]}</td><td>{customer.q[2]}</td><td>{customer.q[3]}</td><td>{customer.q[4]}</td><td>{customer.q[5]}</td><td>{customer.q[6]}</td><td>{customer.countOfStudents}</td><td>{customer.countOfTeachers}</td></tr>
											
										</div>
									))}
									
								</div>
							</div>
						</div>
					</div>




				</div>
			</main>

		</div>
	);
}

export default Disciplina2;
